const Home = () => {
    const [menu, setMenu] = useState(false)

    const toggleMenu = () => {
        setMenu(!menu)
    }

    return (
        <>
            <div className="container">
                <div>
                    <p>ROUTINES</p>
                    <button onClick={toggleMenu} className='routinesButton'><DownOutlined /></button>
                    <nav className={`Cabecera-nav ${menu ? 'isActive' : ''}`}>
                        <ul className="Cabecera-ul">
                            <li className="Cabecera-li"><a href="/home" className="Cabecera-a">What's WRC?</a></li>
                            <li className="Cabecera-li"><a href="/calendar" className="Cabecera-a">Calendar of Rallies</a></li>
                            <li className="Cabecera-li"><a href="/list" className="Cabecera-a">Actual Car List</a></li>
                            <li className="Cabecera-li"><a href="/group-b" className="Cabecera-a">The Legendary Group B</a></li>
                        </ul>
                    </nav>
                </div>
                <a href="/exercises" className='item'>EXERCISES<DownOutlined id="downout" /></a>
                <a href="/supplementation" className='item'>SUPPLEMENTATION<DownOutlined id="downout" /></a>
            </div>
        </>
    )

}

export default Home
